import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import { BlockchainProvider } from './contexts/BlockchainContext';

// Components
import ModernLayout from './components/ModernLayout';

// Pages
import Login from './pages/Login';
import ModernDashboard from './pages/ModernDashboard';
import UserDashboard from './pages/UserDashboard';
import AdminDashboard from './pages/AdminDashboard';
import AdminAnalytics from './pages/AdminAnalytics';
import AdminProjects from './pages/AdminProjects';
import ProjectList from './pages/ProjectList';
import ProjectCreate from './pages/ProjectCreate';
import Verification from './pages/Verification';
import Marketplace from './pages/Marketplace';
import CarbonCredits from './pages/CarbonCredits';
import PaymentDistribution from './pages/PaymentDistribution';
import Reports from './pages/Reports';

// Protected Route Component
const ProtectedRoute = ({ children }) => {
  const { user } = useAuth();
  return user ? children : <Navigate to="/login" replace />;
};

// Admin Route Component
const AdminRoute = ({ children }) => {
  const { user } = useAuth();
  return user && user.role === 'admin' ? children : <Navigate to="/dashboard" replace />;
};

function AppRoutes() {
  const { user } = useAuth();

  return (
    <Routes>
      <Route 
        path="/login" 
        element={user ? <Navigate to="/dashboard" replace /> : <Login />} 
      />

      <Route path="/" element={<Navigate to="/dashboard" replace />} />

      <Route
        path="/dashboard"
        element={
          <ProtectedRoute>
            <ModernLayout pageTitle="Dashboard">
              <ModernDashboard />
            </ModernLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/projects"
        element={
          <ProtectedRoute>
            <ModernLayout pageTitle="Projects">
              <ProjectList />
            </ModernLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/projects/create"
        element={
          <ProtectedRoute>
            <ModernLayout pageTitle="Create Project" breadcrumbs={[{label: 'Projects', path: '/projects'}, {label: 'Create', path: '/projects/create', isLast: true}]}>
              <ProjectCreate />
            </ModernLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/verification"
        element={
          <ProtectedRoute>
            <ModernLayout pageTitle="Verification">
              <Verification />
            </ModernLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/marketplace"
        element={
          <ProtectedRoute>
            <ModernLayout pageTitle="Marketplace">
              <Marketplace />
            </ModernLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/carbon-credits"
        element={
          <ProtectedRoute>
            <ModernLayout pageTitle="Carbon Credits">
              <CarbonCredits />
            </ModernLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/reports"
        element={
          <ProtectedRoute>
            <ModernLayout pageTitle="Reports">
              <Reports />
            </ModernLayout>
          </ProtectedRoute>
        }
      />

      {/* Admin Routes */}
      <Route
        path="/admin/dashboard"
        element={
          <AdminRoute>
            <ModernLayout pageTitle="Admin Dashboard">
              <AdminDashboard />
            </ModernLayout>
          </AdminRoute>
        }
      />

      <Route
        path="/admin/analytics"
        element={
          <AdminRoute>
            <ModernLayout pageTitle="Analytics" breadcrumbs={[{label: 'Admin', path: '/admin/dashboard'}, {label: 'Analytics', path: '/admin/analytics', isLast: true}]}>
              <AdminAnalytics />
            </ModernLayout>
          </AdminRoute>
        }
      />

      <Route
        path="/admin/projects"
        element={
          <AdminRoute>
            <ModernLayout pageTitle="Manage Projects" breadcrumbs={[{label: 'Admin', path: '/admin/dashboard'}, {label: 'Projects', path: '/admin/projects', isLast: true}]}>
              <AdminProjects />
            </ModernLayout>
          </AdminRoute>
        }
      />

      <Route
        path="/admin/payments"
        element={
          <AdminRoute>
            <ModernLayout pageTitle="Payment Distribution" breadcrumbs={[{label: 'Admin', path: '/admin/dashboard'}, {label: 'Payments', path: '/admin/payments', isLast: true}]}>
              <PaymentDistribution />
            </ModernLayout>
          </AdminRoute>
        }
      />

      {/* Settings and Profile routes */}
      <Route
        path="/settings"
        element={
          <ProtectedRoute>
            <ModernLayout pageTitle="Settings">
              <div style={{ padding: '24px' }}>
                <h2>Settings Page</h2>
                <p>Settings content will be implemented here.</p>
              </div>
            </ModernLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/profile"
        element={
          <ProtectedRoute>
            <ModernLayout pageTitle="Profile">
              <div style={{ padding: '24px' }}>
                <h2>Profile Page</h2>
                <p>User profile content will be implemented here.</p>
              </div>
            </ModernLayout>
          </ProtectedRoute>
        }
      />

      {/* Catch all route */}
      <Route path="*" element={<Navigate to="/dashboard" replace />} />
    </Routes>
  );
}

function App() {
  return (
    <AuthProvider>
      <BlockchainProvider>
        <Router>
          <AppRoutes />
        </Router>
      </BlockchainProvider>
    </AuthProvider>
  );
}

export default App;
